import logo from './logo.svg';
import './App.css';
import { Icon } from '@iconify/react';

function App() {
  return (
      <section className='main'>
          <article className='main-content'>
            <a href="/papildymas.html" className="main-link"><button className='main-button'><Icon icon="mdi-light:home" class/>Papildyti sąskaitą</button></a>
            <a href="/isvedimas.html" className="main-link"> <button className='main-button'><iconify-icon icon="solar:cash-out-broken" className="main-icon"></iconify-icon>Išvesti pinigus</button></a>
            <a href="/pervedimas.html" className="main-link"><button className='main-button'><iconify-icon icon="fa6-solid:money-bill-transfer" className="main-icon"></iconify-icon>Pervesti pinigus į kitą sąskaitą</button></a>
        </article>
      </section>

  );
}

export default App;
